import { h } from '@stencil/core';
import { IconBlockquote } from '../components/icons/blockquote.js';
import { IconCode } from '../components/icons/code.js';
import { IconEllipsisHorizontal } from '../components/icons/more.js';
import { IconImage } from '../components/icons/image.js';
import { IconOl } from '../components/icons/ol.js';
import { IconUl } from '../components/icons/ul.js';
export const renderIcon = (icon) => {
  switch (icon) {
    case 'code':
      return h(IconCode, null);
    case 'ul':
      return h(IconUl, null);
    case 'ol':
      return h(IconOl, null);
    case 'hr':
      return h(IconEllipsisHorizontal, null);
    case 'img':
      return h(IconImage, null);
    case 'blockquote':
      return h(IconBlockquote, null);
    default:
      return undefined;
  }
};
